import React from 'react';
import styled from 'styled-components';

const LogoContainer = styled.div`
  display: flex;
  align-items: center;
  gap: ${props => props.theme.spacing.sm};
  cursor: pointer;
  transition: ${props => props.theme.transitions.base};

  &:hover {
    transform: scale(1.05);
  }
`;

const LogoIcon = styled.div`
  width: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  height: ${props => props.size === 'large' ? '48px' : props.size === 'medium' ? '36px' : '28px'};
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const LogoText = styled.span`
  font-family: ${props => props.theme.fonts.primary};
  font-weight: ${props => props.theme.fontWeights.bold};
  font-size: ${props => props.size === 'large' ? props.theme.fontSizes['2xl'] : 
                        props.size === 'medium' ? props.theme.fontSizes.xl : 
                        props.theme.fontSizes.lg};
  background: ${props => props.theme.colors.gradientPrimary};
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  letter-spacing: -0.02em;
`;

const LokanexLogo = ({ size = 'medium', showText = true, ...props }) => {
  return (
    <LogoContainer {...props}>
      <LogoIcon size={size}>
        <svg
          width="100%"
          height="100%"
          viewBox="0 0 100 100"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          {/* Main triangle (L shape) */}
          <path
            d="M30 30 L30 70 L70 70 L70 50 L50 50 L50 30 Z"
            fill="url(#triangleGradient)"
            stroke="url(#triangleStroke)"
            strokeWidth="1"
          />

          {/* Orange piece moved away */}
          <rect
            x="55"
            y="25"
            width="15"
            height="15"
            fill="url(#orangeGradient)"
            rx="2"
          />

          {/* Connection line to show the relationship */}
          <line
            x1="50"
            y1="30"
            x2="55"
            y2="32.5"
            stroke="url(#connectionGradient)"
            strokeWidth="2"
            opacity="0.6"
          />

          {/* Background glow */}
          <circle
            cx="50"
            cy="50"
            r="45"
            fill="url(#bgGlow)"
            opacity="0.2"
          />

          {/* Gradients */}
          <defs>
            <linearGradient id="triangleGradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#00d4ff" />
              <stop offset="50%" stopColor="#4ecdc4" />
              <stop offset="100%" stopColor="#0099cc" />
            </linearGradient>
            <linearGradient id="triangleStroke" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#ffffff" />
              <stop offset="100%" stopColor="#e0e0e0" />
            </linearGradient>
            <linearGradient id="orangeGradient" x1="0%" y1="0%" x2="100%" y2="100%">
              <stop offset="0%" stopColor="#ff6b35" />
              <stop offset="50%" stopColor="#ff8c42" />
              <stop offset="100%" stopColor="#ff6b35" />
            </linearGradient>
            <linearGradient id="connectionGradient" x1="0%" y1="0%" x2="100%" y2="0%">
              <stop offset="0%" stopColor="#4ecdc4" />
              <stop offset="100%" stopColor="#ff6b35" />
            </linearGradient>
            <radialGradient id="bgGlow" cx="50%" cy="50%" r="50%">
              <stop offset="0%" stopColor="#00d4ff" stopOpacity="0.3" />
              <stop offset="70%" stopColor="#4ecdc4" stopOpacity="0.2" />
              <stop offset="100%" stopColor="#ff6b35" stopOpacity="0.1" />
            </radialGradient>
          </defs>
        </svg>
      </LogoIcon>
      {showText && <LogoText size={size}>Lokanex</LogoText>}
    </LogoContainer>
  );
};

export default LokanexLogo;
